import React from 'react'
import axios from 'axios';
import {useNavigate} from "react-router-dom"
import { useState, useEffect } from 'react'

const Home = () => {

    const [itemData, setItemData] = useState({
        item_name: '',
        file_1: ''
    })

    const { item_name, file_1 } = itemData

    const onChange = (e) => {
        setItemData((prevState) => ({
            ...prevState,
            [e.target.name]: e.target.value,
        }))
        console.log(e.value)
    }

    const onSubmit = (e) => {
        e.preventDefault()
        axios.post("http://localhost:8888/api/item", {
            item_name: itemData.item_name,
            file_1: itemData.file_1 
        })
        .then((res) => {
            console.log(res)
        })
        .catch((error) => {
            console.log(error)
        })
    }

  return (
    <section className="main">
        <div className="container grid">
            <div className="main-text">
                <h1>Efficient Approach</h1>
                <p>Work out camera provide you a chance to figure out your weak points objectively.  Upload a video of your movement, let's get started! </p>
            </div>

            <div className="main-form card">
                <h2>Quick Start</h2>
                <form onSubmit={onSubmit}>
                    <div className="form-control">
                    <p>Upload your video here</p>
                        <input id="file_1" type="file" name="file_1" accept=".mp4" value={file_1} onChange={onChange} required />
                    </div>
                    <div className="form-control">
                        {/* <input id="fileupload_2" type="file" name="fileupload_2" accept=".mp4" required /> */}
                    </div>
                    <div className="form-control">
                        <input type="text" id="item_name" name="item_name" placeholder="Type item name here" value={item_name} onChange={onChange} required/>
                    </div>
                    <input type="submit" value="Upload" className="btn btn-primary"/>
                </form>
            </div>
        </div>
    </section>
  )
}

export default Home
